import React from "react";
import { useNavigate } from "react-router-dom";

const Logout = () => {
    let navigate = useNavigate()
    localStorage.clear()
    navigate('/Login')

    return (
        <>
        <button type="button" onClick={Logout} class="btn btn-danger">Logout</button>
        </>
    )
}


export default Logout;
